// CustomerTable.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const CustomerTable = () => {
  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    // Fetch customer data from the backend
    axios.get('/api/customers') // Replace with your backend API route
      .then(response => {
        setCustomers(response.data); // Assuming data is an array of customer objects
      })
      .catch(error => {
        console.error('Error fetching customer data:', error);
      });
  }, []);

  return (
    <div>
      <h2>Customer List</h2>
      <table className="min-w-full table-auto border-collapse">
        <thead>
          <tr>
            <th className="px-4 py-2 border">Name</th>
            <th className="px-4 py-2 border">Email</th>
            <th className="px-4 py-2 border">Phone</th>
            <th className="px-4 py-2 border">Address</th>
          </tr>
        </thead>
        <tbody>
          {customers.length === 0 ? (
            <tr>
              <td colSpan="4" className="text-center py-2">No customers found</td>
            </tr>
          ) : (
            customers.map(customer => (
              <tr key={customer._id}>
                <td className="px-4 py-2 border">{customer.name}</td>
                <td className="px-4 py-2 border">{customer.email}</td>
                <td className="px-4 py-2 border">{customer.phone}</td>
                <td className="px-4 py-2 border">{customer.address}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default CustomerTable;
